import React from 'react';

const RecurringAppointments = () => {
  return (
    <div className="recurring-appointments">
      <h1>Recurring Appointments</h1>
      <div className="recurring-appointments-content">
        <p>Recurring appointments management will be implemented here.</p>
      </div>
    </div>
  );
};

export default RecurringAppointments;
